import React from 'react';
import './App.css';
import Nav from './Components/Nav.js'
import MainPage from './Components/MainPage'

import { BrowserRouter as Router, Swithch, Route } from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <MainPage />
      </div>
    </Router>
  );
}

export default App;
